import React from 'react';
import DetalPost from './DetalPost';
import { useSelector } from 'react-redux';

const PostsList = () => {
  const counter = useSelector(state => state.posts)

  return (
    <section>
      <ul className="space-y-4 ml-4">
        <DetalPost />
      </ul>
    </section>
  );
};

export default PostsList;
